package com.dist.bean;

/**
 * 这个是boss信息的实体类.
 * 
 * @author Administrator
 *
 */
public class Boss {
	
	//
	private String flush_time;
	private String map_name;
	private String id;
	private String minute;
	private String name;
	private String hour;
	private String second;
	private String daojishi;
	private String dead_time;
	private String y;
	private String x;
	private String tic;
	
	
	public String getFlush_time() {
		return flush_time;
	}
	public void setFlush_time(String flush_time) {
		this.flush_time = flush_time;
	}
	public String getMap_name() {
		return map_name;
	}
	public void setMap_name(String map_name) {
		this.map_name = map_name;
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getMinute() {
		return minute;
	}
	public void setMinute(String minute) {
		this.minute = minute;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getHour() {
		return hour;
	}
	public void setHour(String hour) {
		this.hour = hour;
	}
	public String getSecond() {
		return second;
	}
	public void setSecond(String second) {
		this.second = second;
	}
	public String getDaojishi() {
		return daojishi;
	}
	public void setDaojishi(String daojishi) {
		this.daojishi = daojishi;
	}
	public String getDead_time() {
		return dead_time;
	}
	public void setDead_time(String dead_time) {
		this.dead_time = dead_time;
	}
	public String getY() {
		return y;
	}
	public void setY(String y) {
		this.y = y;
	}
	public String getX() {
		return x;
	}
	public void setX(String x) {
		this.x = x;
	}
	public String getTic() {
		return tic;
	}
	public void setTic(String tic) {
		this.tic = tic;
	}
	
}
